        $this->insert('{{%common_log}}',['id'=>'476','app_id'=>'backend','merchant_id'=>'0','user_id'=>'1','method'=>'POST','module'=>'backend','controller'=>'news','action'=>'edit','url'=>'/backend/news/edit','get_data'=>'{"id": "26"}','post_data'=>'{"News": {"tags": "数据中心,abb", "type": "27", "cover": "/attachment/2020/12/08/20120816295799659.png", "title": "编译PHP扩展的方法 ", "covers": "", "status": "1", "content": "<p>\r\n\t<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">构建PHP扩展</span><br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">你已经知道如何去编译PHP本身，下一步我们将编译外部扩展。我们将讨论扩展的构建过程和可用的编译选项。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">载入共享扩展</span><br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">在前一个章节你已经知道，PHP 扩展既能构建成静态库也可以构建成动态库（.so）。大多数静态库是与 PHP 捆绑在一起编译的，动态库可以显式地传递参数 --enable-EXTNAME=shared 或 --with-EXTNAME=shared 给 ./configure。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">静态扩展默认是可用的，动态库需要增加 extension 或者 zend_extension 的 ini 配置。俩者可以是绝对路径，也可以是相对路径。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">例如编译 PHP 扩展用项目的配置项：</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src&gt; ./configure --prefix=$HOME/myphp</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;--enable-debug --enable-maintainer-zts</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;--enable-opcache --with-gmp=shared</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">这个例子中 opcache 扩展和 GMP 扩展都被编译为位于 modules/ 目录中的共享对象。 您可以通过更改extension_dir或通过传递绝对路径来加载：</span><br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src&gt; sapi/cli/php -dzend_extension=`pwd`/modules/opcache.so</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-dextension=`pwd`/modules/gmp.so</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\"># or</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src&gt; sapi/cli/php -dextension_dir=`pwd`/modules</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-dzend_extension=opcache.so -dextension=gmp.so</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">在 make install 步骤中，这两个 .so 文件会被移进 PHP 安装的扩展目录，你使用 php-config --extension-dir 命令可能可以找到它。对于上面的构建选项，它将是 /home/myuser/myphp/lib/php/extensions/no-debug-non-zts-MODULE_API。这个值也是 extension_dir 配置选项的默认值，所以你无需明确地指定它，就可以直接加载进扩展：</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">1</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/myphp&gt; bin/php -dzend_extension=opcache.so -dextension=gmp.so</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">这给我们留下了一个问题：你应该使用哪种机制？共享对象使你有一个基本的 PHP 二进制文件并通过 php.ini 加载其他扩展。发行版通过原始的 PHP 软件包和将扩展作为单独的软件包分发来利用此功能。另一方面，如果你编译自己的 PHP 二进制文件，则可能不需要这个，因为你已经知道需要哪些扩展。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">根据经验，你将对 PHP 本身捆绑的扩展使用静态链接，并将共享扩展用于其他地方。原因很简单，就像你稍后看到的，构建外部扩展为共享对象的更容易（或至少减少了侵入性）。另一个好处是你可以在不用重新构建 PHP 的情况下更新扩展。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">注意</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">如果你需要有关扩展和 Zend 扩展之间差异的信息，你可以查阅专门章节。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">从 PECL 安装扩展</span><br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">PECL，PHP 扩展社区库，提供了大量的 PHP 扩展。当扩展从主 PHP 发行版中删除，它们通常还在 PECL中。同样，现在与 PHP 捆绑一起的许多扩展以前都是 PECL 扩展。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">除非你在 PHP 构建的配置步骤指定 --without-pear，否则 make install 将PECL 作为 PEAR 的一部分下载并安装。你可以在 $PREFIX/bin 目录下找到 pecl 脚本。现在安装扩展很简单，就像运行 pecl install EXTNAME 一样，例如：</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/myphp&gt; bin/pecl install apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">该命令将下载、编译并安装 APCu 扩展。结果会是 apcu.so 文件在扩展目录下，可以通过传递 extension=apcu.so 配置选项来加载此文件。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">虽然 pecl install 对终端用户非常方便，但扩展开发人员对它没什么兴趣。在下面，我们将会说明两种手动构建扩展的方式：通过将其导入主要的 PHP 源码树（允许静态链接）或通过外部构建（仅共享）。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">添加扩展到 PHP 源码树</span><br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">第三方扩展和捆绑在 PHP 的扩展之间没有根本上的区别。因此你可以通过复制外部扩展到 PHP 源码树，并和通常的构建过程一样来构建。我们以APCu 作为例子来演示。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">首先，你要把扩展的源代码放到 PHP 源码树的 ext/EXTNAME 目录。如果扩展可通过 Git 获得，就像从 ext/ 中克隆仓库一样简单：</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src/ext&gt; git clone https://github.com/krakjoe/apcu.git</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">或者你也可以下载源码压缩包并解压它：</span><br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp&gt; wget http://pecl.php.net/get/apcu-4.0.2.tgz</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp&gt; tar xzf apcu-4.0.2.tgz</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp&gt; mkdir ~/php-src/ext/apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp&gt; cp -r apcu-4.0.2/. ~/php-src/ext/apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">该扩展会包含一个 config.m4 文件，该文件指定autoconf文件使用的特定扩展构建指令。 为了将它们包含在 /configure 脚本，你必须再次运行 ./buildconf。为了确保配置文件已经重新生成，建议事先删除它：</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">1</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src&gt; rm configure &amp;&amp; ./buildconf --force</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">现在你可以使用 ./config.nice 脚本将 APCu 添加到你的现有配置，或者从全新的配置行开始：</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src&gt; ./config.nice --enable-apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\"># or</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/php-src&gt; ./configure --enable-apcu # --other-options</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">最后，运行 make -jN 执行实际的构建。由于我们没有使用 --enable-apcu=shared，该扩展已经静态链接到 PHP 库，即不需要额外的操作即可使用它。显然，你也可以使用 make install 去安装最后的二进制文件。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">使用 phpize 构建扩展</span><br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">还可以通过使用构建 PHP章节提及到的 phpize 脚本与 PHP 分开构建。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">phpize 的作用与 ./buildconf 用于 PHP 构建的脚本相似：第一，通过$PREFIX/lib/php/build 复制文件导入 PHP 构建系统到你的扩展中。这些文件是 acinclude.m4（PHP 的 M4宏）、phpize.m4（它会在你的扩展中重命名为 configure.in 并包含主要的构建说明）和 run-tests.php。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">然后 phpize 将调用 autoconf 生成 ./configure 文件，该文件可以自定义扩展构建。注意，没必要传递 --enable-apcu 给它，因为这是隐式假定的。相反，你应该使用 --with-php-config 指定你的 php-config 脚本路径：</span><br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp/apcu-4.0.2&gt; ~/myphp/bin/phpize</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Configuring for:</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">PHP Api Version:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20121113</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Zend Module Api No:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20121113</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Zend Extension Api No:&nbsp;&nbsp; 220121113</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp/apcu-4.0.2&gt; ./configure --with-php-config=$HOME/myphp/bin/php-config</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">/tmp/apcu-4.0.2&gt; make -jN &amp;&amp; make install</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">当你构建扩展时，你应该总是指定 --with-php-config 选项（除非你只有一个全局的 PHP 安装），否则 ./configure 无法确定要构建的 PHP 版本和标志。指定 php-config 脚本也确保了 make install 将移动生成的 .so 文件（可以在 modules/ 目录找到）到正确的扩展目录。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">由于在 phpize 阶段还复制了 run-tests.php 文件，因此你可以使用 make test（或显示调用 run-tests）运行扩展测试。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">删除已编译对象的 make clean 也是可用的，并且允许你增量构建失败时强制重新构建扩展。 另外 phpize 提供了一个清理选项 phpize --clean。该命令将删除所有 phpize 导入的文件和通过 /configure 脚本生成的文件。</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">显示关于扩展的信息</span><br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">PHP CLI 二进制文件提供了几个选项来显示关于扩展的信息。你已经知道 -m，该命令会列出所有已经下载的扩展。你可以利用它来确定扩展是否正确下载了：</span><br />\r\n<br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/myphp/bin&gt; ./php -dextension=apcu.so -m | grep apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">还有其他一些以 --r 开头的参数都是具有 Reflection 功能。例如，你可以使用 --ri 去显示扩展的配置：</span><br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/myphp/bin&gt; ./php -dextension=apcu.so --ri apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">APCu Support =&gt; disabled</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Version =&gt; 4.0.2</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">APCu Debugging =&gt; Disabled</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">MMAP Support =&gt; Enabled</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">MMAP File Mask =&gt;</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Serialization Support =&gt; broken</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Revision =&gt; $Revision: 328290 $</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Build Date =&gt; Jan&nbsp; 1 2014 16:40:00</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">&nbsp;</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Directive =&gt; Local Value =&gt; Master Value</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apc.enabled =&gt; On =&gt; On</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apc.shm_segments =&gt; 1 =&gt; 1</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apc.shm_size =&gt; 32M =&gt; 32M</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apc.entries_hint =&gt; 4096 =&gt; 4096</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apc.gc_ttl =&gt; 3600 =&gt; 3600</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">apc.ttl =&gt; 0 =&gt; 0</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\"># ...</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">--re 参数列出扩展添加的所有初始设置、常数、函数和类：</span><br />\r\n<br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">~/myphp/bin&gt; ./php -dextension=apcu.so --re apcu</span><br />\r\n<br />\r\n<span style=\"font-family:&quot;font-size:14px;background-color:#EEEEEE;\">Extension [&nbsp;</span>extension #27 apcu version 4.0.2 ] {<br />\r\n<br />\r\n&nbsp;&nbsp;- INI {<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;Entry [ apc.enabled&nbsp;]<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Current = '1'<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;}<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;Entry [ apc.shm_segments&nbsp;]<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Current = '1'<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;}<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;# ...<br />\r\n<br />\r\n&nbsp;&nbsp;}<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n&nbsp;&nbsp;- Constants [1] {<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;Constant [ boolean APCU_APC_FULL_BC ] { 1 }<br />\r\n<br />\r\n&nbsp;&nbsp;}<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n&nbsp;&nbsp;- Functions {<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;Function [&nbsp;function apcu_cache_info ] {<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Parameters [2] {<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Parameter #0 [&nbsp;$type ]<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Parameter #1 [&nbsp;$limited ]<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;}<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;# ...<br />\r\n<br />\r\n&nbsp;&nbsp;}<br />\r\n<br />\r\n}<br />\r\n<br />\r\n--re 参数仅适用普通扩展，Zend 扩展使用 --rz 代替。 你可以在 opcache 上尝试：<br />\r\n<br />\r\n<br />\r\n~/myphp/bin&gt; ./php -dzend_extension=opcache.so --rz \"Zend OPcache\"<br />\r\n<br />\r\nZend Extension [ Zend OPcache 7.0.3-dev Copyright (c) 1999-2013 by Zend Technologies&nbsp;<http: www.zend.com=\"\" style=\"margin: 0px; padding: 0px;\">]<br />\r\n<br />\r\n如你所见， 该命令没有显示有用的信息。因为 opcache 同时注册了普通扩展和 Zend 扩展， 前者包含所有初始配置、常量和函数。因此在这个特殊的案例中，你仍然需要使用 --re。其他 Zend 扩展通过 --rz 可得到信息。<br />\r\n<br />\r\n扩展 API 兼容性<br />\r\n扩展对5个主要因素非常敏感。如果它们不合适，则该扩展将不会加载到 PHP中，并将无用：<br />\r\n<br />\r\nPHP Api 版本<br />\r\nZend 模块 Api 编号<br />\r\nZend 扩展 Api 编号<br />\r\n调试模式<br />\r\n线程安全<br />\r\nphpize 工具可让你回想它们的一些信息。所以，如果你在调试模式下构建 PHP，并试图加载和使用非调试模式构建的扩展，那它将无法工作。其他检查也一样。<br />\r\n<br />\r\nPHP Api 版本 是内部 API 版本号，Zend 模块 Api 编号 和 Zend 扩展 Api 编号 分别与 PHP 扩展和 Zend 扩展 API 有关。<br />\r\n<br />\r\n那些编号随后作为 C 宏传递给正在构建的扩展，以便它本身可以检查那些参数，并在 C 预处理器 #ifdef 的基础上采用不同的代码路径。当那些编号作为宏传给扩展代码，它们会被写在扩展结构中，以便你每次尝试在 PHP 二进制文件中加载该扩展时，都将对照 PHP 二进制文件本身的编号进行检查。如果不匹配，那么该扩展不会被加载，并显示一条错误信息。<br />\r\n<br />\r\n如果我们看一下扩展的 C 结构，它看起来像这样：<br />\r\n<br />\r\n<br />\r\n<br />\r\nzend_module_entry foo_module_entry = {<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;STANDARD_MODULE_HEADER,<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;\"foo\",<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;foo_functions,<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;PHP_MINIT(foo),<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;PHP_MSHUTDOWN(foo),<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;NULL,<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;NULL,<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;PHP_MINFO(foo),<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;PHP_FOO_VERSION,<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;STANDARD_MODULE_PROPERTIES<br />\r\n<br />\r\n};<br />\r\n<br />\r\n至今，对我们来说有趣的是 STANDARD_MODULE_HEADER 宏。如果我们扩展它，我们可以看到：<br />\r\n<br />\r\n<br />\r\n<br />\r\n#define STANDARD_MODULE_HEADER_EX sizeof(zend_module_entry), ZEND_MODULE_API_NO, ZEND_DEBUG, USING_ZTS<br />\r\n<br />\r\n#define STANDARD_MODULE_HEADER STANDARD_MODULE_HEADER_EX, NULL, NULL<br />\r\n<br />\r\n注意 ZEND_MODULE_API_NO、ZEND_DEBUG、 USING_ZTS 是如何使用的。<br />\r\n<br />\r\n如果查看 PHP 扩展的默认目录，它应该像 no-debug-non-zts-20090626。如你所料，该目录由不同的部分组成：调试模式，其次是线程安全信息，然后是Zend 模块 Api 编号。所以默认情况下，PHP 试图帮你浏览扩展。<br />\r\n<br />\r\n注意<br />\r\n<br />\r\n通常，当你成为一位内部开发人员或扩展开发人员，必须使用调试参数，并且如果必须处理 Windows 平台，线程也会显示出来。你可以针对那些参数的多种情况多次编译同一扩展。<br />\r\n记住，每次新的 PHP 主要/次要版本都会更改参数，比如 PHP Api 版本，这就是为什么你需要针对新的 PHP 版本重新编译的原因。<br />\r\n<br />\r\n<br />\r\n<br />\r\n&gt; /path/to/php70/bin/phpize -v<br />\r\n<br />\r\nConfiguring for:<br />\r\n<br />\r\nPHP Api Version:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20151012<br />\r\n<br />\r\nZend Module Api No:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20151012<br />\r\n<br />\r\nZend Extension Api No:&nbsp;&nbsp; 320151012<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n&gt; /path/to/php71/bin/phpize -v<br />\r\n<br />\r\nConfiguring for:<br />\r\n<br />\r\nPHP Api Version:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20160303<br />\r\n<br />\r\nZend Module Api No:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20160303<br />\r\n<br />\r\nZend Extension Api No:&nbsp;&nbsp; 320160303<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n&gt; /path/to/php56/bin/phpize -v<br />\r\n<br />\r\nConfiguring for:<br />\r\n<br />\r\nPHP Api Version:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20131106<br />\r\n<br />\r\nZend Module Api No:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 20131226<br />\r\n<br />\r\nZend Extension Api No:&nbsp;&nbsp; 220131226<br />\r\n<br />\r\n注意<br />\r\n<br />\r\nZend 模块 Api 编号 本身是使用 年 月 日 的日期格式构建。这是 API 更改和并被标记的日期。Zend 扩展 Api 编号 是 Zend 版本，其次是 Zend 模块 Api 编号。<br />\r\n<br />\r\n注意<br />\r\n<br />\r\n数字太多？是的，一个 API 编号绑定一个 PHP 版本，对任何人来说都足够了，并且可以简化对 PHP 的理解。不幸的是，除了 PHP 版本本身，还增加了3种不同的 API 编号。你应该找哪一个？答案是任何一个：当 PHP 版本演变时，它们三种同时演变。由于历史原因，我们有三种不同编号。<br />\r\n<br />\r\n但是，你是一位 C开发人员，不是吗？为什么不根据这些数字构建一个“兼容的”头文件？我们在我们的扩展中使用了类似这些：<br />\r\n<br />\r\n<br />\r\n<br />\r\n#include \"php.h\"<br />\r\n<br />\r\n#include \"Zend/zend_extensions.h\"<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define PHP_5_5_X_API_NO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 220121212<br />\r\n<br />\r\n#define PHP_5_6_X_API_NO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 220131226<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define PHP_7_0_X_API_NO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 320151012<br />\r\n<br />\r\n#define PHP_7_1_X_API_NO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 320160303<br />\r\n<br />\r\n#define PHP_7_2_X_API_NO&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 320160731<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define IS_PHP_72&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZEND_EXTENSION_API_NO == PHP_7_2_X_API_NO<br />\r\n<br />\r\n#define IS_AT_LEAST_PHP_72 ZEND_EXTENSION_API_NO &gt;= PHP_7_2_X_API_NO<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define IS_PHP_71&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZEND_EXTENSION_API_NO == PHP_7_1_X_API_NO<br />\r\n<br />\r\n#define IS_AT_LEAST_PHP_71 ZEND_EXTENSION_API_NO &gt;= PHP_7_1_X_API_NO<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define IS_PHP_70&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZEND_EXTENSION_API_NO == PHP_7_0_X_API_NO<br />\r\n<br />\r\n#define IS_AT_LEAST_PHP_70 ZEND_EXTENSION_API_NO &gt;= PHP_7_0_X_API_NO<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define IS_PHP_56&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZEND_EXTENSION_API_NO == PHP_5_6_X_API_NO<br />\r\n<br />\r\n#define IS_AT_LEAST_PHP_56 (ZEND_EXTENSION_API_NO &gt;= PHP_5_6_X_API_NO &amp;&amp; ZEND_EXTENSION_API_NO &lt; PHP_7_0_X_API_NO)<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#define IS_PHP_55&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZEND_EXTENSION_API_NO == PHP_5_5_X_API_NO<br />\r\n<br />\r\n#define IS_AT_LEAST_PHP_55 (ZEND_EXTENSION_API_NO &gt;= PHP_5_5_X_API_NO &amp;&amp; ZEND_EXTENSION_API_NO &lt; PHP_7_0_X_API_NO)<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n#if ZEND_EXTENSION_API_NO &gt;= PHP_7_0_X_API_NO<br />\r\n<br />\r\n#define IS_PHP_7 1<br />\r\n<br />\r\n#define IS_PHP_5 0<br />\r\n<br />\r\n#else<br />\r\n<br />\r\n#define IS_PHP_7 0<br />\r\n<br />\r\n#define IS_PHP_5 1<br />\r\n<br />\r\n#endif<br />\r\n<br />\r\n看见了？<br />\r\n<br />\r\n或者更简单（更好）的是使用 PHP_VERSION_ID ，这你可能更熟悉：<br />\r\n<br />\r\n1<br />\r\n<br />\r\n#if PHP_VERSION_ID &gt;= 50600<br />\r\n<br />\r\n---------------------<br />\r\n本文著作权归作者所有。<br />\r\n商业转载请联系作者获得授权，非商业转载请注明出处。<br />\r\n来源地址：https://www.php.cn/php-weizijiaocheng-459724.html<br />\r\n来源：php中文网(www.php.cn)<br />\r\n&copy; 版权声明：转载请附上原文链接！\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>", "summary": "托管数据中心和基础设施提供商Serverius选择ABB作为其两个主要站点的电力基础设施的翻新和扩展的战略合作伙伴。", "user_id": "1", "order_by": "0"}, "covers": "", "_csrf-backend": "K5tocGHH3FMVPbe84tEFDQYFZYeiScaTOAdU6xtYCzFfqhFJBq7tNk9k-Mylh0djfk0U4Oc7rtpCcCSgXyhGew=="}','header_data'=>'{"host": ["advance.test"], "accept": ["text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9"], "cookie": ["zz_backend_identity=3c2fc17803b257a47ab8cdd854de941af1950c46df94ae172d9f730be1e7a1e7a%3A2%3A%7Bi%3A0%3Bs%3A19%3A%22zz_backend_identity%22%3Bi%3A1%3Bs%3A46%3A%22%5B1%2C%22x6xVZi7iauGqzXwxSGPLNHz8nHWDWE75%22%2C2592000%5D%22%3B%7D; _csrf-frontend=7ef6a3fc3c331cf8b851519a2297c238556bc453a316dfe7fefa02093bd47cf9a%3A2%3A%7Bi%3A0%3Bs%3A14%3A%22_csrf-frontend%22%3Bi%3A1%3Bs%3A32%3A%22vQBvRidWGLUlZKS5PmhoCckkdkc4k0_5%22%3B%7D; advanced-backend=98m3p1u35ipn582k9fci4b4slp; _csrf-backend=6161b52ae2083c4b4a79b0af256dde363ef550aa5047665d42ef5a68281b8b48a%3A2%3A%7Bi%3A0%3Bs%3A13%3A%22_csrf-backend%22%3Bi%3A1%3Bs%3A32%3A%22t1y9gi1eZYOpGVBnxHqgErhIzwpKDpMJ%22%3B%7D; zz-frontend=hr6c3sjr0ghumvuplg4j030fc3"], "origin": ["http://advance.test"], "referer": ["http://advance.test/backend/news/edit?id=26"], "connection": ["close"], "user-agent"